import { useState } from "react";
import { Form, Input } from "semantic-ui-react";
const MovieForm = () => {
  const [title, setTitle] = useState("");

  return (
    <Form>
      <Form.Field>
        <Input
          placeholder="Movie Title"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
        />
      </Form.Field>
    </Form>
  );
};

export default MovieForm;
